import React, { useState } from "react";
import { Grid, Tab, Tabs } from "@mui/material";

const [value, setValue] = useState('');

const menuChange = (newValue) => {
    setValue(newValue);
    print(newValue)
  };

const Header = () => {
    return (
        <Grid container spacing={2}>
            <Grid item xs={12}>
                Menu
            </Grid>
            <Grid item xs={12}>
                <Tabs value={value} onChange={menuChange(value)}>
                    <Tab label='First' />
                    <Tab label='Second' />
                    <Tab label='Third' />
                </Tabs>
            </Grid>
        </Grid>
    )
}

export default Header;
